  methods: {
    inputClassesEmail: function inputClassesEmail() {
      var classes = ['appearance-none', 'border', 'border-gray-100', 'font-pt-sans', 'leading-tight', 'mb-2', 'p-4', 'rounded-sm', 'text-base', 'text-gray-600', 'w-full', 'focus', 'outline-none'];
      if (this.hasErrors) classes.push('border-red-thunderbird-700 bg-red-thunderbird-100');
      return classes.join(' ');
    },
    check: function check() {
      var _self = this;

      var filtered = _self.userData.filter(function (ob) {
        return ob['user'].toLowerCase().includes(_self.email.toLowerCase());
      });

      if (filtered != '') {
        return false;
      } else {
        return true;
      }
    },
    inputClassesPassword: function inputClassesPassword() {
      var classes = ['appearance-none', 'border-none', 'font-pt-sans', 'leading-tight', 'p-4', 'rounded-sm', 'text-base', 'text-gray-600', 'w-full', 'focus', 'outline-none', 'pr-24'];
      if (this.hasEmpty) classes.push('border border-red-thunderbird-700 bg-red-thunderbird-100');
      return classes.join(' ');
    },
    isStrongPass: function isStrongPass(password) {
      var regExp = /(?=.*\d)(?=.*[a-z])(?=.*[A-Z])(?=.*[!@#$%&*()]).{10,}/;
      var validPassword = regExp.test(password);
      return validPassword;
    },
    myFunction: function myFunction() {
      var x = this.$refs.password;

      if (x.type === "password") {
        x.type = "text";
        this.fontAwe = ['far', 'eye-slash'];
        this.labelPass = 'Tutup';
      } else {
        x.type = "password";
        this.fontAwe = ['far', 'eye'];
        this.labelPass = 'Lihat';
      }

      x.focus();
    },
    submit: function submit() {
      var _self = this;

      if (this.email === '') {
        this.hasErrors = true;
        this.errorMessageEmail = 'Email harus diisi';
      } else {
        this.hasErrors = false;
      }

      if (this.password === '') {
        this.hasEmpty = true;
        this.errorMessage = 'Kata sandi harus diisi. ';
      } else {
        this.hasEmpty = false;
      }

      if (this.email != '' && this.password != '') {
        console.log(this.isStrongPass(this.password));

        if (this.validateEmail(this.email)) {
          if (this.check()) {
            console.log('user belum ada');
            this.hasSucceeded = true;
          } else {
            console.log('user udah ada');
            this.terdaftar = true;
          }
        } else {
          if (this.validateEmail(this.email) === false) {
            this.hasErrors = true;
            this.errorMessageEmail = 'Masukkan format email yang benar.';
          }

          if (this.isStrongPass(this.password) === false) {
            this.hasEmpty = true;
            this.errorMessage = 'Kata sandi harus sesuai yang ditentukan.';
          }
        }
      }
    },
    validateEmail: function validateEmail(email) {
      var re = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
      return re.test(String(email).toLowerCase());
    }
  }
